      if (!productCode) {
        return []
      }

      await Promise.all([
        fetchIncompleteNutrientsInsightsByProductCode(productCode),
        fetchNutrientsTaxonomies(),
      ])
      return insight(productCode).get()
    },
    args: () => [this.productCode],
